import React from 'react';
import { Container, Row, Col, Nav, Image } from 'react-bootstrap';
import NavBar from './Navbar';
import '../css/home.css';
import {Link} from 'react-router-dom';
import Images from './Images';

export default function Home(){
    return (
        <>
            <NavBar />
            <Container fluid>
                <Row>
                    <Col xs={2} className="mt-4">
                    <Image className="image" src={Images.homeImg}/>
                        <hr/>
                    <Nav defaultActiveKey="/home" className="mt-5 flex-column">
                        <Nav.Link>
                            <Link to="/investments"><span class="fas fa-tasks"> <span className="ml-4">Investments</span></span></Link>
                        </Nav.Link>
                        <Nav.Link>
                        <Link to="/loans"><span class="fas fa-tasks"> <span className="ml-4">Loans</span></span></Link>
                        </Nav.Link>
                        <Nav.Link>
                        <Link to="/investMore"><span class="fas fa-tasks"> <span className="ml-4">Invest More</span></span></Link>
                        </Nav.Link>
                        <Nav.Link>
                        <Link to="/offers"><span class="fas fa-tasks"> <span className="ml-4">Offers</span></span></Link>
                        </Nav.Link>
                        </Nav>
                    </Col>

                </Row>
            </Container>
        </>
    );
}
